import React from "react";

function GetInvolved() {
  return (
    <section id="get-involved">
      <h2>Get Involved</h2>
      <div className="cta">
        <a href="#volunteer" className="cta-button">Volunteer</a>
        <a href="#donate" className="cta-button">Donate Now</a>
      </div>
    </section>
  );
}

export default GetInvolved;
